import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import { ThemeProvider } from '@material-ui/styles';
import './componentsCSS/profileCard.css'

import { theme } from './theme'

const useStyles = makeStyles({
  card: {
    maxWidth: 345,
  },
});

export default function ProfileCard(props) {
  const classes = useStyles();
  const name = `${props.user.firstName} ${props.user.lastName}`

  return (
      <div className="mb-3">
        <ThemeProvider theme={theme}>
            <Card className={classes.card}>
            <CardMedia
            component="img"
            alt={name}
            height="140"
            image="https://cdn0.tnwcdn.com/wp-content/blogs.dir/1/files/2017/08/code-1839406_1920-796x531.jpg"
            title={name}
            />
            <div className="text-center" id="profileCardAvatarContainer">
                <img src="data:image/png;base64," className="rounded-circle img-thumbnail w-50" style={{ backgroundColor: '#7da2a9' }} id="profileCardAvatar" alt="..."/>
            </div>
            <CardContent>
            <Typography gutterBottom variant="h5" component="h2">
                {name}
            </Typography>
            <Typography variant="body2" color="textSecondary" component="p">
                Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging
                across all continents except Antarctica
            </Typography>
            </CardContent>
            <CardActions>
                <Button size="small" color="primary">
                Share
                </Button>
                <Button size="small" color="primary">
                Learn More
                </Button>
            </CardActions>
            </Card>
        </ThemeProvider>
    </div>
  );
}
